import React from 'react';
import Card from './Card'
import items from './items'
import {ListItem, ListItemText, ListItemIcon, IconButton, makeStyles} from '@material-ui/core/';
import RadioButtonUncheckedIcon from '@material-ui/icons/RadioButtonUnchecked';

const usestyles = makeStyles({
    radioButton: {
        borderRadius: 100,
        Color: 'black',
    },
})

const IngredientList = items[0].Ingredients.map((Items,{id}) =>{
    const classes = usestyles;

    return(
        <ListItem dense ContainerComponent="li">
            <input type="checkbox" id={id} className={classes.radioButton}/>
            <label for={id}>
                <ListItemText primary={Items}></ListItemText>
            </label>

        </ListItem>
    );
})


export default IngredientList;
